import React, { Component } from 'react';
import logo from './images/jamiedesignedfinal.svg';
 // import logo from './images/jamiedesignedfinal-color.svg';
import './styles/App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header section-padding">
          <img src={logo} className="App-logo" alt="logo" />
        </header>

        <footer>
           <div className="cities section-padding">
               <ruby>Tokyo <rp>(</rp><rt>トーキョー</rt><rp>)</rp></ruby>
             <h3></h3>
             <h4>|</h4>
             <h3>Dubai</h3>
             <h4>|</h4>
             <h3>Warwick</h3>
          </div>

             <div className="cities section-padding">
             <h3></h3>
             <h4>・</h4>
             <h3>ドゥーバイ</h3>
             <h4>・</h4>
             <h3>ウォリック</h3>
          </div>

            <div id="enter"><a href=""> Enter</a></div>
        </footer>
      </div>
    );
  }

}

export default App;
